import React from "react";

class Nav extends React.Component{
    render(){
        return(
            <div className="nav--top">
                <img src="crane-cloud block.jpeg" alt="logo" />
                <h3>Crane Cloud</h3>
            </div>
        );
    }

}

export default Nav;
